import React, { Component } from 'react';
import './experience.css'

class Experience extends Component {
    constructor() {
        super();

        this.timeline = [
            {
                title : "Azure Fundamentals Certification",
                date : "11-01-2020",
                text : "Successfully cleared the exam for Azure Fundamentals provided by Microsoft (AZ-900)."
            },
            {
                title : "Vistaar Technologies",
                date : "02-07-2018",
                text : "Successfully cleared the exam for Azure Fundamentals provided by Microsoft (AZ-900)."
            },
            {
                title : "Bachlor of Engineering",
                date : "June-2028",
                text : "Graduated as Bachelor of Engineering from Athatva College of Engineering affiliated by Mumbai University with CGPA of 7.60"
            },
            {
                title : "iMac Co-ordinator",
                date : "June-2016",
                text : "Participated as iMac lab Co-ordinator which comprises of conducting sessions on developing ios application using XCODE for students."
            },
        ]
    }

    render() {
        let items = []
        for (let index = 0; index < this.timeline.length; index++) 
        {      
            let obj = this.timeline[index];                      
            items.push(
                <li className="align-items-center">
                    <div className="exp-content">
                        <div className="exp-content-header">
                            <b>{obj.title}<br></br><small className="text-muted">{obj.date}</small></b>
                        </div>
                        <div>
                            <small>{obj.text}</small>
                        </div>
                    </div>
                </li>
            );
        }

        return (
            <div id="experience" className="row banner-experience">
                <div className="col-sm-12">
                    <h4 className="text-primary"> My experience and achivements</h4>
                </div>
                <div className=" container timeline-xp">
                    <ul>
                        {items}
                    </ul>
                </div>
            </div>
        )
    }

}

export default Experience;
